const removeDuplicateLetters = (s) => {
	let stack = [];
	let freqMap = {};
	for(let i=0;i<s.length;i++) {
		freqMap[s[i]] = (freqMap[s[i]] || 0) + 1;
	}
	for(let char of s) {
		if(!stack.includes(char)) {
			while(stack.length && stack[stack.length-1] > char && freqMap[stack[stack.length-1]] > 0) {
				stack.pop();
			}
			if(!stack.includes(char)) {
				stack.push(char);
			}
		}
		freqMap[char]--;
	}
	return stack.join('');
};

